/** @jsxImportSource theme-ui */

import { ThemeProvider } from 'theme-ui';
import { theme } from "./theme";
import WebsiteBuilder from "./organisms/Websitebuilder";


function App() {
  return (
    <ThemeProvider theme={theme}>
      <div>
        <WebsiteBuilder></WebsiteBuilder>
      </div>
    </ThemeProvider> 
  );
}

export default App;
